import React from 'react';
import {BrowserRouter as Router, Switch} from 'react-router-dom';

import './app.scss';
import * as Routes from './routes';

import { RouteWithLayout } from './utilities';
import * as Layouts from './layouts';
import * as Pages from './pages';

function App() {
  return (
    <div className="App">
      <Router basename='/'>
        <Switch>

          <RouteWithLayout exact path={Routes.RIDDASHBOARD} component={Pages.RidDashboardPage} layout={Layouts.RidLayout} />
          <RouteWithLayout exact path={Routes.RIDUSER} component={Pages.RidUserPage} layout={Layouts.RidLayout} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
